			"text": "20대 남성의 보수정당 지지도가 여성의 지지도보다 높다는 건 분명하다. 그런데 조사 숫자는 각각 300여명. 이런 걸 놓고 남녀 격차가 몇배니 하는 얘기가 의미가 있는지 모르겠습니다. 게다가 600명이 지역 등 다른 특성까지 고르게 뽑였는지도 의문.",
